function plusMinus(arr) {
    // Write your code here
    
    const arrLength = arr.length
    let positiveCount = 0
    let negativeCount = 0
    let zeroCount = 0
    arr.map(item => {
        if(item === 0){
            zeroCount++
        } else if(item < 0){
            negativeCount++
        } else if(item > 0){
            positiveCount++
        }
    })
    
    return [(positiveCount/arrLength).toFixed(6), (negativeCount/arrLength).toFixed(6), (zeroCount/arrLength).toFixed(6)]
    

}


