function timeConverter(s){
    const timeArr = s.split(':')
    let hr = 0
    let min = 0
    let sec = 0
    if(timeArr[2].charAt(2)==='P' && timeArr[0] !== '12' ){
        hr = (12 + +timeArr[0]).toString()
        min = timeArr[1]
        sec = timeArr[2].slice(0,2)
    } else if (timeArr[2].charAt(2)==='P' ){
        hr = timeArr[0]
        min = timeArr[1]
        sec = timeArr[2].slice(0,2)
    } else if (timeArr[2].charAt(2)==='A' && timeArr[0] === '12' ){
        hr = '00'
        min = timeArr[1]
        sec = timeArr[2].slice(0,2)
    } else if (timeArr[2].charAt(2)==='A' ){
        hr = timeArr[0]
        min = timeArr[1]
        sec = timeArr[2].slice(0,2)
    }

    const newTime = [hr, min, sec]

    return newTime.join(':')

}

