function staircase(n) {
    // Write your code here
    let init = 1
    let startingArr = []
    
    while(init <= n){
        startingArr.push(' ')
        init++
    }

    let count = 1
    while(count <= n){
        startingArr[n-count] = '#'
        console.log(startingArr.join(''))
        count++
    }
    
}

